import "../styles/SignUpUser.css";

const SignUpUser = () => {
  return (
    <div className="container">
      <form>
        <div>
          <label>
            <span>Insira seu Nome:</span>
            <input type="text" placeholder="Nome" />
          </label>
        </div>
      </form>
    </div>
  );
};

export default SignUpUser;
